import React from "react";
import BottomTabs from "./Screens/BottomTabs";
import {Modal} from "./Screens/Index";
import { NavigationContainer, DarkTheme } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

const RootStack = createStackNavigator();

export default function MainFile(){

  const rootStack = () => {
    return(
        
          <RootStack.Navigator >
            <RootStack.Screen
              name="BottomTab"
              component={BottomTabs}
              options={{
                title: "",
                headerShown: false,
              }}
            />
            <RootStack.Screen mode="modal"></RootStack.Screen>
              name="Modal" component={Modal} 
            />
          </RootStack.Navigator>
        
    );
  }

  const Stack = () => {
    return(
      <NavigationContainer>
        <RootStack.Navigator>
          <RootStack.Group>
            <RootStack.Screen
              name="BottomTab"
              component={BottomTabs}
              options={{
                title: "",
                headerShown: false,
              }}
            />
          </RootStack.Group>
          <RootStack.Group screenOptions={{ presentation: 'modal' }}>
            <RootStack.Screen
              name="Modal" component={Modal} 
            />
          </RootStack.Group>
        </RootStack.Navigator>
      </NavigationContainer>
    );
  }
  return <NavigationContainer>{rootStack()}</NavigationContainer>;
}
